import React from 'react';
import styles from './formInput.css';

const FormInput = ({ label, name, type, value, onChange }) => {
  return (
    <div className={styles.FormInput}>
      <label htmlFor={name}>{label}</label>
      <input
        type={type}
        id={name}
        name={name}
        value={value}
        onChange={onChange}
      />
    </div>
  );
};

export default FormInput;
